import React from "react";
import "./App.css";
import MonthlyCalc from "./Components/MonthlyCalc";
import RelocationCalc from "./Components/RelocationCalc";

function App(props) {
  return (
    <div className="appStart">
      <MonthlyCalc key={Date.now()} />
      <RelocationCalc />
    </div>
  );
}

export default App;
